import React from "react";
const userRoutes = [

    {
        path: "/user/list",
        component: React.lazy(() =>
            import("./users/UsersList")
        )
    },
    {
        path: "/user/:viewType/:id",
        component: React.lazy(() =>
            import("./users/UersFormDetails")
        )
    }
];

export default userRoutes;
